    "",ntt"description": "Compressed Text File of Three Dimensional Thermal
    Model of Newberry Volcano, OregonnnFinal results of a 3D finite difference thermal
    model of Newberry Volcano, Oregon. Model data are formatted as a text file with
    four data columns (X, Y, Z, T). X and Y coordinates are in UTM (NAD83 Zone 10N),
    Z is elevation from mean sea level (meters), T is temperature in u00b0C. Model is
    40km X 40km X 12.5 km, grid node spacing is 100m in X, Y, and Z directions. A symmetric
    cylinder shaped magmatic heat source centered on the present day caldera is the
    modeled heat source. The center of the modeled body is a -1700 m (elevation) and
    is 600m thick with a radius of 8700m. This is the best fit results from 2D modeling
    of the west flank of the volcano. The model accounts for temperature dependent thermal
    properties and latent heat of crystallization. For additional details, assumptions
    made, data used, and a discussion of the validity of the model see Frone, 2015 (http://search.proquest.com/docview/1717633771).",ntt"format":
